const initCategories = {
    categories:[]
};

export const categories = (state = initCategories, action) =>{
    switch (action.type) {
        case 'GET_CATEGORIES' :
            console.log('>>>L',...action.payload.value)
            return {...state.categories, categories: [...action.payload.value]}
        default : 
            return state;
    }
}
